INSERT INTO `menus` (`id`, `nama`, `deskripsi`, `gambar`, `harga`, `tersedia`, `deleted_at`, `created_at`, `updated_at`) VALUES
(1, 'Juice Alpukat', 'Juice Alpukat adalah minuman sehat dan lezat yang terbuat dari buah alpukat yang lembut dan krimi. Alpukat dikenal karena kandungan lemak sehatnya yang baik untuk tubuh.', 'axW9WbLkACC86Tl8GlYgXizMYNOjI8xJBvvn4zMF.png', 10000, 1, NULL, '2024-01-14 02:07:31', '2024-01-14 11:20:13'),
(2, 'Juice Strawberry', 'Juice Strawberry adalah minuman beraroma manis yang terbuat dari buah strawberry yang merah dan segar. Strawberry dikenal karena rasa manis alami dan aroma yang menggoda.', 'SiCFTenwS38WOpelfZUtYTNOy61gwJj3qVJtrfiM.png', 10000, 1, NULL, '2024-01-14 06:58:28', '2024-01-14 11:20:31'),
(3, 'Juice Mangga', 'Jus Mangga adalah minuman yang terbuat dari buah mangga. Kandungan serat pangan dan gula alami yang terdapat di dalam jus mangga sangat aman untuk dikonsumsi penderita penyakit diabetes.', 'au1dxc8hcH9F7PRGWvB4oL5FMvANil7O3PNS1Xk5.png', 10000, 1, NULL, '2024-01-14 06:59:33', '2024-01-14 11:20:49'),
(4, 'Juice Melon', 'Jus Melon adalah minuman yang terbuat dari buah melon. Kandungan antioksidan dalam jus melon membantu mencegah risiko penyakit jantung, kanker, dan penuaan dini.', 'cVMvuWETECAvPohS5VKhs8XAbUQqeXypCIh1JnEs.png', 10000, 1, NULL, '2024-01-14 07:12:39', '2024-01-14 11:21:11'),
(5, 'Juice Jeruk', 'Jus Jeruk adalah jenis minuman yang kaya akan vitamin C. Jus jeruk sering dikonsumsi sebagai minuman sehat, di mana dengan mudah bisa Anda temukan di berbagai restoran.', 'dYaQQmj5CCthJu1wm2YXHDy2yPOo5TCNdGmUFW8S.png', 10000, 1, NULL, '2024-01-14 07:13:02', '2024-01-14 11:21:34'),
(6, 'Juice Kiwi', 'Jus Kiwi adalah minuman yang terbuat dari buah kiwi. Salah satu manfaat dari buah kiwi adalah dapat mengatasi masalah rambut.', 'gcYysWkWufY3J4ImdwJYS2v27aahQefLeDuaq8Yg.png', 10000, 1, NULL, '2024-01-14 07:16:09', '2024-01-14 11:21:51'),
(7, 'Juice Jambu', 'Jus Jambu adalah minuman yang digemari masyarakat indonesia dengan berbahan dasar Buah Jambu Merah Biji yang masih segar dan manis.', 'FcXdYP9HIeju9ThJS5QeL0vEKcHO4kCxPzkk1z1c.png', 10000, 1, NULL, '2024-01-14 07:16:32', '2024-01-14 11:22:08'),
(8, 'Juice Naga', 'Jus Naga adalah minuman yang memiliki segudang manfaat bagi kesehatan tubuh karena mengandung banyak nutrisi yang baik bagi kesehatan.', '1sq6gXqnaJ6DhewAn96RtQqEs3xCbXoEXLPSUke6.png', 10000, 1, NULL, '2024-01-14 07:18:27', '2024-01-14 11:22:26'),
(9, 'Juice Nanas', 'Jus Nanas adalah minuman sehat yang kaya akan nutrisi, seperti vitamin C, bromelain, tiamin, dan beta karoten.', '48oWBrHXr6BF8djhFcyrZw9XKcssZu6BffaxSiTk.png', 10000, 1, NULL, '2024-01-14 07:20:09', '2024-01-14 11:22:43'),
(10, 'Juice Orange', 'Jus Jeruk adalah jenis minuman yang kaya akan vitamin C. Jus jeruk sering dikonsumsi sebagai minuman sehat, di mana dengan mudah bisa Anda temukan di berbagai restoran.', 'OthHpQf0aZyIELDMzwqgBSIML0M5Fv2iK4dsc276.png', 10000, 1, NULL, '2024-01-14 07:20:40', '2024-01-14 11:30:04'),
(11, 'Juice Wortel', 'Jus Tomat adalah minuman yang terbuat dari sari buah tomat.', 'YvOOYKVOMHXKepFcNl7NZiwofypb3tg1horHCHhS.png', 10000, 1, NULL, '2024-01-14 07:21:02', '2024-01-14 11:30:41'),
(12, 'Nutrisari Anggur', 'Nutrisari Anggur adalah salah satu produk minuman sari buah yang populer di Indonesia. Nutrisari adalah merek yang dikenal memproduksi berbagai jenis minuman sari buah yang dikemas dalam bentuk kemasan sachet atau botol.', 'hkfamumBw7ZDcEapPbtbXz25JueWXRMB07H3yDE7.png', 5000, 1, NULL, '2024-01-14 07:23:23', '2024-01-14 11:31:20'),
(13, 'Nutrisari Blewah', 'Nutrisari Blewah adalah minuman serbuk rasa blewah dengan sari buah blewah yang menyegarkan.', 'EgPumtEuz3oSglsO2eKtL7fWLbcYEAikp7QlBQB7.png', 5000, 1, NULL, '2024-01-14 07:23:50', '2024-01-14 11:31:41'),
(14, 'Nutrisari Cincau', 'Nutrisari Cincau adalah minuman sachet dengan rasa yang unik dan menyegarkan.', 'upe7lXQ4pJJv5e293K2fNiy9bFYVjljC8uaR32gI.png', 5000, 1, NULL, '2024-01-14 07:24:16', '2024-01-14 11:32:05'),
(15, 'Nutrisari Jambu', 'Nutrisari Jambu adalah minuman serbuk yang terbuat dari buah jambu biji alami.', '1ePrqKUL4vhflBNEnWw3lAvkAFbPtTbRgFKOaEaY.png', 5000, 1, NULL, '2024-01-14 07:24:54', '2024-01-14 11:32:27'),
(16, 'Nutrisari Jeruk Nipis', 'Nutrisari Jeruk Nipis adalah minuman serbuk instan berperisa jeruk nipis yang segar dan cocok diminum saat cuaca panas.', 'RoJmpxftDxWK8YeiUYpc0pkzw30QMhsdYEmOuhF2.png', 5000, 1, NULL, '2024-01-14 07:25:23', '2024-01-14 11:32:50'),
(17, 'Nutrisari Jeruk Peras', 'Nutrisari Jeruk Peras adalah minuman serbuk kaya vitamin dan mineral dengan rasa jeruk peras yang khas.', 'd9XoZVrMC7nCVHrFOKRltZ2P0lWcU4qb98AzVbCa.png', 5000, 1, NULL, '2024-01-14 07:25:48', '2024-01-14 11:33:12'),
(18, 'Nutrisari Kelapa Muda', 'Nutrisari Kelapa Muda adalah minuman sari buah berbentuk serbuk yang terbuat dari buah kelapa.', 'Ic7dUYmiwMFznEHH6fXtDwfqJhx4yEdf84If6Jiw.png', 5000, 1, NULL, '2024-01-14 07:26:12', '2024-01-14 11:33:32'),
(19, 'Nutrisari Manggo Gandaria', 'Nutrisari Manggo Gandaria adalah minuman serbuk rasa mangga gandaria dengan sari buah mangga gandaria yang menyegarkan.', 'erEKbrithbP8OXW1f8lXoV5PQHq0z5hEmxQREGXm.png', 5000, 1, NULL, '2024-01-14 07:26:40', '2024-01-14 11:34:00'),
(20, 'Nutrisari Semangka', 'Nutrisari Semangka adalah minuman serbuk rasa dengan sari buah yang enak dan menyegarkan.', 'lXZyLDgKAQzbaPDg4M1UNzrKbUg1OzezljBJ2ZTJ.png', 5000, 1, NULL, '2024-01-14 07:27:28', '2024-01-14 11:34:18'),
(21, 'Nutrisari Sweet Orange', 'Nutrisari Sweet Orange adalah minuman serbuk rasa jeruk amerika dengan sari buah jeruk amerika yang menyegarkan.', 'qwUInrXkZC5atBFWwPJ5uVhinmpPgZoNMitwwrzN.png', 5000, 1, NULL, '2024-01-14 07:27:52', '2024-01-14 11:34:35'),
(22, 'Nutrisari Sirsak', 'Nutrisari Sirsak adalah minuman terbuat dari sari buah sirsak alami yang mengandung banyak nutrisi yang baik bagi kesehatan tubuh.', 'RyCMXADgHIKRsypxHT4Mdk3yihpAFbEGQaKDcCeB.png', 5000, 1, NULL, '2024-01-14 07:28:17', '2024-01-14 11:34:50'),
(23, 'Soda Susu', 'Soda Susu adalah minuman yang terdiri dari campuran soda atau air berkarbonasi dengan susu. Minuman ini sering diberi rasa atau pemanis tambahan, seperti sirup atau permen.', 'Y8If485SeAGDl3nroMKcY5S3nt4piBWYP9txqxJd.png', 15000, 1, NULL, '2024-01-14 07:28:45', '2024-01-14 11:41:47'),
(24, 'Drink Bengbeng', 'Minuman seduh yang terbuat dari cokelat, malt, cream dan milk, yang dapat disajikan hanngat ataupun dingin.', 'eakFCbUbpfR4KJtWyBvYwTnE7sByFsop7zyB92YY.png', 10000, 1, NULL, '2024-01-14 07:29:07', '2024-01-14 11:37:31'),
(25, 'Jeruk Peras', 'Jeruk Peras adalah jenis jeruk yang dikenal dengan nama ilmiah Citrus × sinensis. Jeruk peras adalah salah satu varietas jeruk yang paling umum dan banyak ditanam di seluruh dunia.', 'ug19LUm3mxDQaQNgE1pMkMlw41BE0zzFXS9S6x1H.png', 10000, 1, NULL, '2024-01-14 07:29:30', '2024-01-14 11:38:03'),
(26, 'Milo', 'Milo adalah minuman dengan rasa cokelat dan malt.', 'QdOJ9yiUYkiMVYkmNzw60yJ041QxCdTK80Uh4aqt.png', 10000, 1, NULL, '2024-01-14 07:29:51', '2024-01-14 11:38:24'),
(27, 'Aqua', 'Aqua adalah minuman air mineral dalam kemasan yang diproduksi oleh Danone sejak 1973.', 'ZqazdLXqa40CoN69pgyqwtsFnWFxvwgUzeyoKHn9.png', 6000, 1, NULL, '2024-01-14 07:30:15', '2024-01-14 12:20:19'),
(28, 'Teh Tarik', 'Teh Tarik dibuat dengan menyeduh teh hitam kuat, lalu dicampur dengan susu kental manis. Yang membuatnya istimewa adalah proses penyajiannya, di mana teh dicurahkan dari satu wadah ke wadah lain dengan tinggi beberapa kali untuk menghasilkan busa yang kaya.', 'jI4SlDA6rKf4yoI7J2tAIsRe2PW6VmR75YG5nbGi.png', 10000, 1, NULL, '2024-01-14 07:31:04', '2024-01-14 11:39:24'),
(29, 'Teh Manis', 'Teh Manis adalah minuman yang terbuat dari teh yang diseduh dan diberi gula. Minuman Ini adalah minuman yang populer di berbagai budaya di seluruh dunia.', 'BNNYYsWmIYC8roUcgtueuoJyKWTGgURE8fkHfizM.png', 5000, 1, NULL, '2024-01-14 07:31:26', '2024-01-14 11:40:21'),
(30, 'Teh Tawar', 'Teh Tawar adalah minuman yang terbuat dari daun teh yang diseduh dalam air panas tanpa tambahan gula atau susu. Ini adalah bentuk paling sederhana dari teh, di mana cita rasanya didominasi oleh rasa alami daun teh.', 'EpcgPb1qVJup3FjeO3iIGiBtLuapVX92KBtOMArx.png', 3000, 1, NULL, '2024-01-14 07:31:54', '2024-01-14 11:39:58'),
(31, 'Good Day Mocacino', 'Good Day Mocacino adalah campuran kopi kuat dan cokelat panas, disajikan dengan espresso, susu, cokelat, dan whipped cream. Gurih dengan rasa kopi dan cokelat yang nikmat.', 'IVVbsQmMNH2hIcAOGZJmIPUnnRBBVOPeFvSmGE6v.png', 5000, 1, NULL, '2024-01-14 07:34:10', '2024-01-14 11:29:16'),
(32, 'Indocafe', 'Indocafe adalah merek yang dikenal karena produk-produk kopi, terutama kopi instan, yang diproduksi dan dijual di Indonesia. Merek Indocafe dikelola oleh PT Santos Jaya Abadi.', 'l9octlj26lFp2K1st9tHBSTsLddLDgmzrcUZvkHa.png', 5000, 1, NULL, '2024-01-14 07:34:35', '2024-01-14 11:30:30'),
(33, 'White Coffee', 'White Coffee adalah istilah yang digunakan untuk menyebut kopi yang disajikan dengan tambahan susu pekat manis. White Coffee sering dikaitkan dengan kopi yang disajikan di Malaysia, terutama kopi yang terkenal dari daerah Ipoh, Perak, Malaysia.', 'Up7q0AZmIxOOYLtl1tAz6sUTeD8LhIWZk7FiGtTU.png', 5000, 1, NULL, '2024-01-14 07:34:58', '2024-01-14 11:31:07'),
(34, 'ABC Susu', 'Kopi ABC Susu adalah perpaduan antara kopi mantap, gula, dan susu nikmat yang diproses secara modern.', 'ib39k9Mfd83OF6WIsAgcKUs2yMTuJooZ6RRlmnLD.png', 5000, 1, NULL, '2024-01-14 07:35:19', '2024-01-14 11:31:48'),
(35, 'Kapal Api', 'Kopi Kapal Api merupakan salah satu merek kopi hitam yang sangat terkenal di Indonesia.', 'oTO8K9pKGS4hfb3RHI6AVUbOvLDewrM4lelG1V8n.png', 5000, 1, NULL, '2024-01-14 07:35:44', '2024-01-14 11:32:30'),
(36, 'Kopi Aceh (Gayo)', 'Kopi Gayo adalah varietas kopi Arabika yang berasal dari daerah Gayo, Aceh, Indonesia. Kopi Gayo dikenal karena kualitasnya yang tinggi dan memiliki citarasa yang unik.', 'bzq4d7jM7hTVtx803Mpqd0XYeDzJ36bvyPRXbDu3.png', 10000, 1, NULL, '2024-01-14 07:36:07', '2024-01-14 11:34:59'),
(37, 'Kopi Medan', 'Minuman ini terkenal karena kualitas kopi arabika yang tumbuh di daerah Sumatera Utara. Kopi Medan sering kali memiliki ciri khas rasa yang kuat dan penuh, dengan sentuhan rasa yang cenderung beraroma kental dan manis.', 'Aue5iHKahV9wHDQe0akpaxabKOfAmi6ntcw9oRbK.png', 10000, 1, NULL, '2024-01-14 07:36:26', '2024-01-14 11:35:32'),
(38, 'Kopi Bali', 'Kopi Bali adalah minuman kopi yang khas berasal dari pulau Bali, Indonesia. Kopi ini sering dikenal dengan sebutan \"Kopi Bali Kintamani\" karena daerah Kintamani di Bali terkenal dengan produksi biji kopi yang berkualitas tinggi.', 'owsneWCnnEDkc2aJh3IOiFSr96sYdDuQFalFdfrO.png', 10000, 1, NULL, '2024-01-14 07:36:48', '2024-01-14 11:36:00'),
(39, 'Kopi Lampung', 'Kopi Lampung adalah varietas kopi yang berasal dari daerah Lampung di Indonesia. Kopi Lampung terkenal karena memiliki cita rasa dan aroma yang khas.', 'OGkKL7MV6pbdNVQ1asbtp2LCxBYLXWH2mVgkABoA.png', 10000, 1, NULL, '2024-01-14 07:37:09', '2024-01-14 11:36:23'),
(40, 'Kopi Toraja', 'Kopi Toraja, dari Toraja, Sulawesi, Indonesia, adalah kopi dengan rasa kaya, aroma unik, kompleks, dengan sentuhan rempah-rempah dan asam yang seimbang.', 'FjMEt1I6oepAMEF4K7j0SDfWXBE4oVq8IxgJQgQl.png', 10000, 1, NULL, '2024-01-14 07:37:28', '2024-01-14 11:36:51'),
(41, 'Pisang Bakar', 'Pisang bakar dibuat dengan memanggang pisang dengan sedikit minyak hingga berwarna kecokelatan. Kemudian pisang bakar disajikan dengan parutan keju atau tambahan topping lainnya.', 'HNrvLdFTvX1ZczOTXVZJxldHeISX6VEmwWe17fcr.png', 10000, 1, NULL, '2024-01-14 07:38:17', '2024-01-14 11:37:45'),
(42, 'Kentang Goreng', 'Kentang goreng adalah hidangan yang dibuat dari potongan-potongan kentang yang digoreng dalam minyak goreng panas.', '8sJu0pxE9q8BRGTLEfenZk1YHIPHqzuRLCsrxcDs.png', 10000, 1, NULL, '2024-01-14 07:38:38', '2024-01-14 11:38:26'),
(43, 'Otak Otak', 'Otak-otak merupakan salah satu makanan yang terbuat dari ikan dan sudah dicincang, selain itu bahan utama dari otak-otak adalah ikan tenggiri', 'QqGuCV033FSQtK7jHQHKA7ru8c1DRan5QPXFGDE9.png', 8000, 1, NULL, '2024-01-14 07:39:01', '2024-01-14 11:39:20'),
(44, 'Roti Bakar', 'Roti bakar adalah sebuah roti lapis khas Indonesia yang dibakar, yang terdiri dari dua potong roti dan isian, seperti gula, margarin, mentega, dan meses coklat.', 'blatYyK3BZPohrJ2rznvoNMGgDxoPNn6g9w4Nve4.png', 10000, 1, NULL, '2024-01-14 07:39:14', '2024-01-14 11:39:58'),
(45, 'Perpaket Mendoan', 'Perpaket Mendoan terdiri dari tempe mendoan yang disajikan panas-panas dengan ditemani cabai rawit dan sambal kecap manis, yang membuat cita rasa tempe mendoan lebih bervariasi.', '4scQiyv5iCsvMWyfrsDwfqvREAJmZrdRloc7g47H.png', 10000, 1, NULL, '2024-01-14 07:39:38', '2024-01-14 11:41:17'),
(46, 'Sosis Bakar', 'Sosis bakar adalah sosis panggang atau sosis barbeque yang merupakan salah satu olahan makanan yang terbuat dari daging sapi dan ayam.', 'X6DM0wGZS7VBa9Rlrm3nRTxxpnJ5ktoJP7iXIit0.png', 10000, 1, NULL, '2024-01-14 07:40:17', '2024-01-14 11:41:46'),
(47, 'Mie Rebus Telor', 'Mie rebus telor adalah hidangan yang populer di banyak budaya di seluruh dunia. Ini adalah hidangan yang sederhana tetapi lezat yang melibatkan mie yang direbus hingga matang dan disajikan dengan kuah kaldu dan telur.', 'Kf8k4pIbvLoKWgF5HDNQaF6urjHxiUDXwq3AedTd.png', 12000, 1, NULL, '2024-01-14 07:42:12', '2024-01-14 11:42:18'),
(48, 'Mie Rebus', 'Mie rebus adalah hidangan yang populer di banyak budaya di seluruh dunia. Ini adalah hidangan yang sederhana tetapi lezat yang melibatkan mie yang direbus hingga matang dan disajikan dengan kuah kaldu.', 'IWUzM5VTHByJZxzEfvSUenuNIaAvt63QpLca2diS.png', 8000, 1, NULL, '2024-01-14 07:42:30', '2024-01-14 11:43:05'),
(49, 'Mie Goreng Gledeg', 'Mie goreng gledeg adalah hidangan mie goreng yang memiliki rasa yang sangat pedas. Biasanya, mie goreng gledeg menggunakan mie sebagai bahan utama yang digoreng bersama dengan berbagai bumbu dan bahan tambahan.', '2V9lh8jTRTKA9TZlIQz6vPNHiIfeX8T2fyyshNI9.png', 15000, 1, NULL, '2024-01-14 07:42:48', '2024-01-14 11:43:41'),
(50, 'Mie Goreng Telor', 'Mie Goreng Telor adalah hidangan Asia yang populer dan terkenal di seluruh dunia. Ini adalah hidangan mie yang diolah dengan cara digoreng dengan berbagai bahan rempah-rempah dan telur, menciptakan rasa yang lezat dan menggugah selera. Disertai telor yang bisa direbus atau di goreng sesuai dengan selera anda.', 'zxM43HyaoyUwBhf13nLOdMg7dhjqP3HZ4uUeZ3Rk.png', 12000, 1, NULL, '2024-01-14 07:43:13', '2024-01-14 11:45:31'),
(51, 'Mie Goreng', 'Mie goreng adalah hidangan Asia yang populer dan terkenal di seluruh dunia. Ini adalah hidangan mie yang diolah dengan cara digoreng dengan berbagai bahan dan rempah-rempah, menciptakan rasa yang lezat dan menggugah selera', 'hLLyOlsfo9SAzZwMCzda6ysqQOC5b0yeG4wbLftu.png', 8000, 1, NULL, '2024-01-14 07:44:06', '2024-01-14 11:47:09'),
(52, 'Kwetiaw Goreng', 'Kwetiaw goreng adalah hidangan kuliner populer di Asia. Ini terdiri dari kwetiaw yang digoreng dan dicampur dengan daging, telur, sayuran, dan berbagai bumbu seperti kecap manis dan saus ikan.', '1bMR9Gzj0oBiHUwAJmcYVsWjEENuqkTYhXwhSf74.png', 15000, 1, NULL, '2024-01-14 07:44:26', '2024-01-14 11:47:50'),
(53, 'Nasi Goreng', 'Nasi goreng adalah makanan berupa nasi yang digoreng dan dicampur dalam minyak goreng, margarin, atau mentega. Biasanya ditambah dengan kecap manis, bawang merah, bawang putih, asam jawa, lada dan bahan lainnya', 'nfLJupWxYJWHcPOrLWHjYj39L199x4HkPDJW1tHV.png', 15000, 1, NULL, '2024-01-14 07:44:58', '2024-01-14 11:48:54'),
(54, 'Nasi Telor', 'Nasi telor adalah sebuah hidangan yang cocok untuk mahasiswa, karena harganya yang sangat murah. Hidangan ini hanya tersusun dari telur dadar atau ceplok yang digoreng', 'GG12OAxSFDLwTuicoEt8bO2jxfJsTxYQiOXzJa2H.png', 10000, 1, NULL, '2024-01-14 07:45:13', '2024-01-14 12:17:04'),
(55, 'Nasi Bebek', 'Nasi bebek adalah hidangan dengan nasi dan daging bebek yang digoreng, lezat dengan bumbu dan sambal khas.', '6wvFS4xiqdHFmIjLLYkjEqzEJymeuE01ptU1ey1I.png', 40000, 1, NULL, '2024-01-14 07:45:30', '2024-01-14 11:49:30'),
(56, 'Nasi Putih', 'Nasi putih merupakan salah satu makanan pokok masyarakat Indonesia. Selain harganya murah dan mudah didapat, kandungan nutrisi nasi putih juga baik untuk kesehatan dan bermanfaat bagi tubuh.', 'UkJcHkEUf49PZPkL46RjT5TpEutQXbHM2kDtTa6L.png', 5000, 1, NULL, '2024-01-14 07:45:47', '2024-01-14 11:49:59'),
(57, 'Ayam Penyet + Nasi + Teh Manis', 'Ayam Penyet + Nasi + Teh Manis adalah hidangan khas Indonesia yang terkenal dengan rasa pedas, gurih, dan lezatnya.', 'ABQvnM4RX1zioMlghSrA68oMl5ZmUWpgz8J9kt0g.png', 20000, 1, NULL, '2024-01-14 07:46:48', '2024-01-14 11:51:05'),
(58, 'Ayam Geprek + Nasi + Teh Manis', 'Ayam Geprek + Nasi + Teh Manis adalah hidangan khas Indonesia yang sedang naik daun. Hidangan ini terdiri dari ayam goreng yang diuleg atau \"geprek\" bersama sambal pedas.', '0lbSGe9AQzo9ww3ng9uzdKzWBFUSiMz2aB0PscWY.png', 20000, 1, NULL, '2024-01-14 07:47:09', '2024-01-14 11:51:46'),
(59, 'Pecel Lele + Nasi + Teh Manis', 'Pecel Lele + Nasi + Teh Manis adalah hidangan tradisional Indonesia yang menggugah selera, terkenal karena cita rasa yang khas dan tekstur lele yang renyah.', 'R1nP7SgblwPmWwNRO85kdUmjrdFOOS16oa2VqEtz.png', 15000, 1, NULL, '2024-01-14 07:47:31', '2024-01-14 11:52:21'),
(60, 'Udang Asam Manis + Nasi + Teh Manis', 'Udang Asam Manis + Nasi + Teh Manis adalah hidangan khas Indonesia yang terbuat dari udang yang digoreng dan disajikan dengan saus asam manis yang khas. Hidangan ini memiliki rasa yang seimbang antara asam dan manis, dan seringkali memiliki cita rasa yang gurih dan pedas.', 'uICWfvj82v6H57ZazyYMfWfh6SId5Wk9dtlnAHwc.png', 35000, 1, NULL, '2024-01-14 07:47:50', '2024-01-14 11:53:58'),
(61, 'Cumi Asam Manis + Nasi + Teh Manis', 'Cumi Asam Manis + Nasi + Teh Manis adalah hidangan masakan khas Indonesia yang terbuat dari cumi-cumi yang digoreng dan disajikan dengan saus asam manis yang khas. Sama seperti Udang Asam Manis, hidangan ini juga memiliki rasa yang seimbang antara asam dan manis.', 'ZCkmcWphTNYbEKsvV36pxxcxQ8yMRx45uQ5mGd17.png', 35000, 1, NULL, '2024-01-14 07:48:17', '2024-01-14 11:54:33'),
(62, 'Pecak Bawal + Nasi + Teh Manis', 'Pecak Bawal + Nasi + Teh Manis adalah hidangan masakan Indonesia yang menggunakan bawal sebagai bahan utama. Hidangan ini biasanya terdiri dari bawal yang digoreng atau dibakar hingga garing, kemudian disajikan dengan saus pedas yang khas.', 'eUP6ABHd1NVUHDm5vZ0DXPZSE4UFfWwxygu4L7QY.png', 20000, 1, NULL, '2024-01-14 07:48:35', '2024-01-14 11:55:27');
